import { BrowserRouter as Router, Link } from 'react-router-dom'

import Home from './components/Home'

function App() {
  return (
    <div className="App">
      <header className="App-header">
              </header>
              <Router>
                <Route to={Home} exact path='./components/Home'></Route>
              </Router>
    </div>
  );
}

export default App;
